import React, { useEffect, useState } from 'react';
import "./buycours.css"
import axios from 'axios';
import {useLocation, useNavigate } from 'react-router-dom';

function Buycours() {


  const [valid,setValid] = useState([])
    const [userid,setUserid] = useState([]) 
    const [user,setUser] = useState([]) 


  const [buycourse,setBuycourse] = useState({
    id_course: "",
    id_user: "",
    date: "",//new Date().toISOString().slice(0, 19).replace('T', ' ')
  });



  axios.defaults.withCredentials = true;
  useEffect(()=>{
    const fecthAllUser = async () =>{
        try{
          const res = await axios.get("http://localhost:8800")
          setValid(res.data.valid)
          setUserid(res.data.ID);

        }catch(err){
            console.log(err)
        }
    }
    fecthAllUser()

// Устанавливаем текущую дату и время при загрузке компонента
const currentDate = new Date();
const formattedDate = currentDate.getFullYear() + '-' + 
                      String(currentDate.getMonth() + 1).padStart(2, '0') + '-' + 
                      String(currentDate.getDate()).padStart(2, '0') + ' ' + 
                      String(currentDate.getHours()  + 3).padStart(2, '0') + ':' + 
                      String(currentDate.getMinutes()).padStart(2, '0') + ':' + 
                      String(currentDate.getSeconds()).padStart(2, '0');
setBuycourse(prevState => ({
  ...prevState,
  date: formattedDate
}));



},[])

const location = useLocation();
  const queryParams = new URLSearchParams(location.search);
  const courseId = queryParams.get('courseId');

useEffect(() => {
    
    if (userid && courseId) {
      setBuycourse(prevState => ({
        ...prevState,
        id_course: courseId,
        id_user: userid
      }));
    }
  }, [userid, courseId]);


  
    
   


const buycors = async e =>{
    e.preventDefault()
    try{
        const response = await axios.post("http://localhost:8800/buycourse", buycourse)
        console.log('Response:', response.data);    
        
      }catch(err){
  
      }
}

if(valid){
    return (
        <div className="mainvin checkout-form-container">
          <h2>Payment Information</h2>
          <form  className="checkout-form">
            <div className="form-group">
              <label htmlFor="cardNumber">Card Number</label>
              <input
                type="text"
                id="cardNumber"
                value={cardNumber}
                onChange={(e) => setCardNumber(e.target.value)}
                required
              />
            </div>
            <div className="form-group">
              <label htmlFor="expiryDate">Expiry Date (MM/YY)</label>
              <input
                type="text"
                id="expiryDate"
                value={expiryDate}
                onChange={(e) => setExpiryDate(e.target.value)}
                required
              />
            </div>
            <div className="form-group">
              <label htmlFor="cvv">CVV</label>
              <input
                type="text"
                id="cvv"
                value={cvv}
                onChange={(e) => setCvv(e.target.value)}
                required
              />
            </div>
            <div className="form-group">
              <label htmlFor="cardName">Name on Card</label>
              <input
                type="text"
                id="cardName"
                value={cardName}
                onChange={(e) => setCardName(e.target.value)}
                required
              />
            </div>
            <button type="submit" className="submit-button">Submit Payment</button>
          </form>
        </div>
      );
  }else{
    return (
     <div>
          Войди в акаунт
          <button onClick={buycors}>КУПИТЬ</button>
      </div>
    );
  }
}
export default Buycours;
